import React from "react";

export default class About extends React.Component {
  render() {
    return (
      <div>
        <p>
          <b> Jie Liang Lin (USA)</b> is an interdisciplinary artist and media
          anthropologist based in Berlin.
          <br />
          <br />
          <br />
          <u>Project Consultants: </u>
          <ul>
            <li>
              <b>Joanna Sleigh (CH)</b> on <i>Data Visualisation</i>
            </li>
            <li>
              <b>Peggy Sylopp (DE)</b> on <i>Computer Science</i>
            </li>
          </ul>
          <br />
        </p>
      </div>
    );
  }
}
